import React, { useState } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import PersonaService from '../services/PersonaService';

const Register = () => {
  const [formData, setFormData] = useState({
    primerNombre: "",
    segundoNombre: "",
    primerApellido: "",
    segundoApellido: "",
    identificacion: "",
    email: "",
    fechaNacimiento: "",
    ubicacion: {
      lugar: "",
      ciudad: "",
      departamento: "",
    },
    usuario: {
      login: "",
      password: "",
    },
  });

  const [alertInfo, setAlertInfo] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    if (name.includes(".")) {
      const [objectName, field] = name.split(".");
      setFormData((prevData) => ({
        ...prevData,
        [objectName]: {
          ...prevData[objectName],
          [field]: value,
        },
      }));
    } else {
      setFormData((prevData) => ({ ...prevData, [name]: value }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const currentDate = new Date();
    const selectedDate = new Date(formData.fechaNacimiento);
    const year = selectedDate.getFullYear();

    // Validaciones de fecha de nacimiento
    if (selectedDate > currentDate) {
      setAlertInfo({ type: 'danger', message: 'La fecha de nacimiento no puede ser futura.' });
      return;
    }

    if (year < 1900 || year > 2100) {
      setAlertInfo({ type: 'danger', message: 'El año de nacimiento debe estar entre 1900 y 2100.' });
      return;
    }

    // Preparar los datos para enviar
    const dataToSend = {
      ...formData,
      identificacion: parseInt(formData.identificacion),
      usuario: {
        ...formData.usuario,
        id: {
          login: formData.usuario.login,
          persona: null,
        },
      },
    };

    try {
      // Llama al método adecuado para registrar al usuario
      const response = await PersonaService.registerUser(dataToSend); // Cambia a registerUser
      setAlertInfo({ type: 'success', message: response.message || 'Registro exitoso.' });
      // Opcional: redirigir a otra página después de registrar
    } catch (error) {
      setAlertInfo({ type: 'danger', message: error.message || 'Error en la solicitud.' });
    }
  };

  return (
    <div className="container-fluid py-5" style={{ 
      background: 'linear-gradient(to right, #212531, #c9b1ff)', 
      minHeight: '100vh'
    }}>
      <div className="row justify-content-center">
        <div className="col-md-8">
          <div className="card">
            <div className="card-header bg-primary text-white">
              <h2 className="mb-0">Registrar Persona</h2>
            </div>
            <div className="card-body">
              {alertInfo && (
                <div className={`alert alert-${alertInfo.type}`} role="alert">
                  {alertInfo.message}
                </div>
              )}
              <form onSubmit={handleSubmit}>
                {/* Inputs para la información de la persona */}
                <div className="row mb-3">
                  <div className="col-md-6">
                    <label className="form-label">Primer Nombre:</label>
                    <input
                      type="text"
                      name="primerNombre"
                      className="form-control"
                      value={formData.primerNombre}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="col-md-6">
                    <label className="form-label">Segundo Nombre:</label>
                    <input
                      type="text"
                      name="segundoNombre"
                      className="form-control"
                      value={formData.segundoNombre}
                      onChange={handleChange}
                    />
                  </div>
                </div>
                {/* ... otros campos de formulario ... */}
                <h3>Usuario</h3>
                <div className="row mb-3">
                  <div className="col-md-6">
                    <label className="form-label">Login:</label>
                    <input
                      type="text"
                      name="usuario.login"
                      className="form-control"
                      value={formData.usuario.login}
                      onChange={handleChange}
                      required
                    />
                  </div>
                  <div className="col-md-6">
                    <label className="form-label">Password:</label>
                    <input
                      type="password"
                      name="usuario.password"
                      className="form-control"
                      value={formData.usuario.password}
                      onChange={handleChange}
                      required
                    />
                  </div>
                </div>
                <button type="submit" className="btn btn-primary">
                  Guardar
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
